  <script type="text/javascript">
    var drawBubbleChart = function(dataset, containerSelector, units, colors){
      var diameter = 600;
      var bubble = d3.pack(dataset)
        .size([diameter, diameter])
        .padding(1.5);
      var svg = d3.select(containerSelector)
            .append("svg")
            .attr("width", diameter)
            .attr("height", diameter)
            .attr("class", "bubble");
      var nodes = d3.hierarchy(dataset)
        .sum(function(d) { return d["Count"]; });
      var node = svg.selectAll(".node")
        .data(bubble(nodes).descendants())
        .enter()
        .filter(function(d){
          return  !d.children
        })
        .append("g")
        .attr("class", "node")
        .attr("transform", function(d) {
          return "translate(" + d.x + "," + d.y + ")";
        });
      node.append("title")
        .text(function(d) {
            return d.data["Type"] + ": " + d.data["Count"];
        });
      node.append("circle")
        .attr("r", function(d) {
            return d.r;
        }).style("fill", function(d,i) {
            return colors[i];
        });
      node.append("text")
        .attr("dy", "-1em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Date"];
        })
        .attr("font-family",  "Gill Sans", "Gill Sans MT")
        .attr("font-size", function(d){
            return d.r/8;
        })
        .attr("fill", "white");
      node.append("text")
        .attr("dy", "0.4em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Type"].substring(0, d.r / 3);
        })
        .attr("font-family", "sans-serif")
        .attr("font-size", function(d){
            return d.r/5;
        })
        .attr("fill", "white");
      node.append("text")
        .attr("dy", "1.4em")
        .style("text-anchor", "middle")
        .text(function(d) {
            return d.data["Count"].toFixed(2) + units;
        })
        .attr("font-family",  "Gill Sans", "Gill Sans MT")
        .attr("font-size", function(d){
            return d.r/5;
        })
        .attr("fill", "white");
      d3.select(self.frameElement)
        .style("height", diameter + "px");
    }
    var drawTimeChart = function(day, month, year, aggregate) {
      var onFootTotalTime = _.reduce(Object.values(statistics.onFootTimeSec[2018]), (memo, month) => {
        return _.reduce(Object.values(month), (memo2, day) => {
          return memo2 + day;
        }, 0);
      }, 0);
      var onVehicleTotalTime = _.reduce(Object.values(statistics.onVehicleTimeSec[2018]), (memo, month) => {
        return _.reduce(Object.values(month), (memo2, day) => {
          return memo2 + day;
        }, 0);
      }, 0);
      var dataset = {
        "children": [
          {"Date": year, "Type": "ON FOOT", "Count": onFootTotalTime/3600},
          {"Date": year, "Type": "ON FOOT", "Count": onVehicleTotalTime/3600},
        ]
      };
      drawBubbleChart(dataset, "#timeChart", "h", ["#1976D2", "#388E3C"]);
    };
    var drawDistanceChart = function(day, month, year, aggregate) {
      var onFootTotalDistance = _.reduce(Object.values(statistics.onFootDistance[2018]), (memo, month) => {
        return _.reduce(Object.values(month), (memo2, day) => {
          return memo2 + day;
        }, 0);
      }, 0);
      var onVehicleTotalDistance = _.reduce(Object.values(statistics.onVehicleDistance[2018]), (memo, month) => {
        return _.reduce(Object.values(month), (memo2, day) => {
          return memo2 + day;
        }, 0);
      }, 0);

      var dataset = {
        "children": [
          {"Date": year, "Type": "ON FOOT", "Count": onFootTotalDistance/1000},
          {"Date": year, "Type": "VEHICLE", "Count": onVehicleTotalDistance/1000},
        ]
      };
      drawBubbleChart(dataset, "#distanceChart", "km", ["#1976D2", "#388E3C"]);
    };
    drawTimeChart(undefined, undefined, "2018");
    drawDistanceChart(undefined, undefined, "2018");
  </script>
